import React from 'react'
import { Container, Row, Col } from "react-bootstrap";

const projects = [{
    id: '1',
    name: 'Sneaker Webshop',
    stack: ["React", "CommerceJS", "Material-UI"],
    status: 'WIP'
    },
    {
    id: '2',
    name: 'Verktyg för lantbrukare',
    stack: 'React, Firebase, Material-UI,',
    status: 'WIP'
    }

]

const Portfolio = () => {
    return (
        <Container>
            <Row>
                <Col xs={12} sm={6}>
                    <p>Hej, mitt namn är</p>
                    <h1>Max</h1>
                    <p>Jag är en utvecklare med fler sidor än bara kod</p>
                </Col>
            </Row>
            <Row>
                <h4>Projekt</h4>
                {projects.map((project) => (
                    <Col key={project} xs={12} sm={3} className="projectCard">
                        <p>{project.id}</p>
                        <h6>{project.name}</h6>
                        <p>{project.status}</p>
                    </Col>
                ))}
            </Row>
        </Container>
    )
}

export default Portfolio
